//import React from 'react';
import React, { Component } from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import { Container, Row, Col } from 'reactstrap';
import { Button } from 'reactstrap';


export default class PriceAdmin extends Component {
    render() {
      return (

        <Container>
            <Row>
                <Col>
                <Button color="primary" size="lg" block>View/Edit Price Model</Button>{'/ViewCurrent'}                    
                </Col>
          </Row>
          <Row>
              <p></p>
          </Row>
          <Row>
                <Col>
                <Button color="primary" size="lg" block>Create New Price Model</Button>                    
                </Col>
          </Row>
          <Row>
              <p></p>
          </Row>
          <Row>
                <Col>
                <Button color="primary" size="lg" block>Compare Price Models</Button>                    
                </Col>
          </Row>

        </Container>

      )
    }
  }
